import React, { useEffect } from "react";
import QueueList from "./QueueList";
import TableConfigForm from "./TableConfigForm";

const StaffDashboard = ({ restaurantId }) => {
  const [queue, setQueue] = useState([]); // 存储队列数据
  const [tableConfig, setTableConfig] = useState(null); // 存储桌子配置
  const [loading, setLoading] = useState(true); // 控制加载状态
  const [error, setError] = useState(null); // 错误信息


  useEffect(() => {
    console.log("Rendering StaffDashboard for restaurant:", restaurantId);
  }, [restaurantId]);

  return (
    <div>
      <h2>Staff Dashboard for {restaurantId}</h2>
      <QueueList restaurantId={restaurantId} />
      <TableConfigForm restaurantId={restaurantId} />
    </div>
  );
};

const fetchQueueData = async () => {
  try {
    const response = await axios.get(`http://localhost:5001/api/${restaurantId}/queue`);
    setQueue(response.data.queue || []);
  } catch (err) {
    console.error("Error fetching queue data:", err);
    setError("Failed to load queue data.");
  }
};


export default StaffDashboard;
